import { makeStyles } from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import backgroundimg from "../../../public/assets/caurong.png";
export default function AppMobile(props) {
  const classes = useStyles();
  const ref = useRef({});
  return (
    <div className={classes.root}>
      <div className={classes.bgimages}>
        <div className={classes.appmobile}>
          <div className={classes.doawload}></div>
          <div className={classes.mobile}></div>
        </div>
      </div>
    </div>
  );
}
const useStyles = makeStyles((theme) => ({
  root: {
    height: 600,
    // background: "#F8FBFF",
    // backgroundImage: `url(${backgroundimg})`
  },
  bgimages: {
    backgroundImage: `url(${backgroundimg})`,
    width: "100%",
    height: "100%",
  },
  appmobile:{
    padding:'0 50px'
  },
  doawload:{
    width:'50%'
  },
  mobile:{
    width:'50%'
  }
}));
